import React from "react";
import Footer from "../Footer/footer";
import Header from "../Header/header";
import Body from "../Body/body";
import "./home.css";
function Home() {
  return (
    <>
      <Header />
      <Body />
      <Footer />
    </>
  );
}

export default Home;
